import './App.css';
import PlainCalendarHeatmap from "./PlainCalendarHeatmap";
import BarChart from "./BarChart";

function App() {
    return (
    <div className="App">
        <header className="App-header" >
            <PlainCalendarHeatmap/>
            <BarChart/>
        </header>
    </div>
  );
}

export default App;
